min-version: '1.4'
class: FeatureSource
sources:
  wfs:
    protocol: wfs
    url: http://services.land.vic.gov.au/catalogue/publicproxy/guest/dv_geoserver/wfs
  wfs2:
    protocol: wfs2
    url: http://services.land.vic.gov.au/catalogue/publicproxy/guest/dv_geoserver/wfs    
features:
  
  contours-10m:
  - source: wfs
    name: VMELEV_EL_CONTOUR
    category: FEATURE_TYPE_CODE
  - source: wfs
    name: VMELEV_EL_CONTOUR
    label-only: true
    label: ALTITUDE
    filter: FEATURE_TYPE_CODE IN ('contour_index','contour_dep_index')
  
  sand: 
   source: wfs
   name: VMELEV_GROUND_TYPE_SAND
  
  vineyard-orchard:
   source: wfs
   name: VMFEAT_FOI_POLYGON
   filter: FEATURE_SUBTYPE IN ('vineyard','orchard') 
  
  lookout:
   source: wfs2
   name: VMFEAT_FOI_POINT
   filter: FEATURE_SUBTYPE IN ('lookout')  
  
  spotheight:
   source: wfs
   name: VMELEV_EL_GRND_SURFACE_POINT
   label: ALTITUDE
   filter: FEATURE_TYPE_CODE IN ('spot_height')
  
  mountain:
   source: wfs
   name: VMELEV_EL_GRND_TYPE_POINT
   label: NAME
   filter: FEATURE_TYPE_CODE IN ('mountain')
  
  groundtype:  
   source: wfs
   name: VMELEV_GROUND_TYPE_ROCK_OC
   
  snowpole:
   source: wfs2
   name: VMFEAT_FOI_POINT
   label: NAME_LABEL
   filter: FEATURE_SUBTYPE IN ('snow pole')
   
  emergencymarker:
   source: wfs2
   name: VMFEAT_FOI_POINT
   label: NAME_LABEL
   filter: FEATURE_SUBTYPE IN ('emergency marker')
   
  camp:
   source: wfs2
   name: VMFEAT_FOI_POINT
   label: NAME_LABEL
   filter: FEATURE_SUBTYPE IN ('camp ground')
  gates:
   source: wfs2
   name: VMTRANS_GATE
   filter: FEATURE_TYPE_CODE IN ('gate')
   rotate: ROTATION
   rotation-style: arithmetic 
  excavation:
   source: wfs
   name: VMFEAT_FOI_POLYGON
   filter: FEATURE_TYPE IN ('excavation site')
   category: FEATURE_SUBTYPE
  swamps-inundation:
   source: wfs
   name: VMHYDRO_HY_WATER_AREA_POLYGON
   filter: FEATURE_TYPE_CODE IN ('flat_sti','wetland_swamp')
   category: FEATURE_TYPE_CODE
  coastline:
   source: wfs
   name: VMINDEX_FR_FRAMEWORK_AREA_LINE
   filter: FEATURE_TYPE_CODE = 'coast'     
  ferry-routes:
   source: wfs
   name: VMTRANS_TR_ROAD
   filter: FEATURE_TYPE_CODE IN ('ferry_route')
  watercourses:
   source: wfs
   name: VMHYDRO_HY_WATERCOURSE
   category:
   - HIERARCHY
   - FEATURE_TYPE_CODE
   label: NAME
  stock-dams:
  - source: wfs
    name: VMHYDRO_HY_WATER_POINT
    filter: FEATURE_TYPE_CODE IN ('wb_dam')
  - source: wfs
    name: VMHYDRO_HY_WATER_STRUCT_POINT
    filter:
    - FEATURE_TYPE_CODE IN ('watering_place')
    - STRUCTURE_TYPE IN ('3') 
  waterfalls:
   source: wfs
   name: VMHYDRO_HY_WATER_POINT
   filter: FEATURE_TYPE_CODE IN ('waterfall')
   rotate: ROTATION
   rotation-style: arithmetic 
   label: NAME
  waterbodies:
   source: wfs
   name: VMHYDRO_HY_WATER_AREA_POLYGON
   filter: FEATURE_TYPE_CODE NOT IN ('flat_sti','wetland_swamp')
   category:
    WATERBODY_STATE:
     "1": Intermittent
     "2": Perennial
     ~: Perennial
  railways:
   source: wfs
   name: VMTRANS_TR_RAIL
   filter:
    - FEATURE_TYPE_CODE NOT IN ('rail_uground_o','tunnel_rail_o','rail_trail')
    - PHYSICAL_CONDITION NOT IN ('1')
   category:
    RAIL_GAUGE:
     ~: Standard
     "1": Standard
     "2": Broad
     "3": Broad
     "4": Narrow 
     "5": Narrow       
  tanks:
   source: wfs
   name: VMHYDRO_HY_WATER_STRUCT_POINT
   filter: FEATURE_TYPE_CODE IN ('tank_water')  
  transmission-lines:
   source: wfs
   name: VMFEAT_FOI_LINE
   filter: FEATURE_TYPE IN ('power line') 
  state-border:
   source: wfs
   name: VMINDEX_FR_FRAMEWORK_AREA_LINE
   filter: FEATURE_TYPE_CODE = 'state_border'
  place-names:
   source: wfs
   name: VMFEAT_LOCALITY_POINT
   label-only: true
   label: PLACE_NAME_LABEL
  huts:
   source: wfs2
   name: VMFEAT_FOI_POINT
   filter: FEATURE_SUBTYPE IN ('hut') 
   label-only: true
   label: NAME_LABEL  
  sealed_hwy_fwy_art_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('0','1','2')
     - ROAD_SEAL NOT IN ('2')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('0','1','2')
     - ROAD_SEAL NOT IN ('2')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL       
  unsealed_hwy_fwy_art_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
    - CLASS_CODE IN ('0','1','2')
    - ROAD_SEAL NOT IN ('1','3')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('0','1','2')
     - ROAD_SEAL NOT IN ('1','3')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL       
  sealed_subarterial_collector_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('3','4')
     - ROAD_SEAL NOT IN ('2')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('3','4')
     - ROAD_SEAL NOT IN ('2')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL     
  unsealed_subarterial_collector_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('3','4')
     - ROAD_SEAL NOT IN ('1','3')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('3','4')
     - ROAD_SEAL NOT IN ('1','3')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL    
  sealed_local_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('5')
     - ROAD_SEAL NOT IN ('2')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('5')
     - ROAD_SEAL NOT IN ('2')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL 
  unsealed_local_roads:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('5')
     - ROAD_SEAL NOT IN ('1','3')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('5')
     - ROAD_SEAL NOT IN ('1','3')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL
  4wdtrack:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: CLASS_CODE IN ('7')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('7')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL
  2wdtrack:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: CLASS_CODE IN ('6')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('6')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL   
  walk_cycle_tracks:
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: CLASS_CODE IN ('11','12')
  - source: wfs
    name: VMTRANS_TR_ROAD
    filter: 
     - CLASS_CODE IN ('11','12')
     - ROAD_NAME NOT IN ('UNNAMED')
    label-only: ture
    label: EZI_ROAD_NAME_LABEL 
    




sealed_hwy_fwy_art_roads:
  stroke-width: 0.6
  stroke: red
unsealed_hwy_fwy_art_roads:
  stroke-width: 0.6
  stroke: "#FF7518"
sealed_subarterial_collector_roads:
  stroke-width: 0.5
  stroke: red
unsealed_subarterial_collector_roads:
  stroke-width: 0.5
  stroke: "#FF7518"
sealed_local_roads:
  stroke-width: 0.4
  stroke: red
unsealed_local_roads:
  stroke-width: 0.4
  stroke: "#FF7518"
walk_cycle_tracks:
